

-- ================================================================
-- Tabla: interviews
-- ================================================================

DROP TABLE IF EXISTS "interviews" CASCADE;
CREATE TABLE "interviews" ("id" UUID NOT NULL, "application_id" UUID NOT NULL, "stage" interview_stage NOT NULL, "interview_date" TIMESTAMP WITH TIME ZONE, "rubric" JSONB, "recommendation" TEXT, "created_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(), "updated_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now());

ALTER TABLE "interviews" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: invites
-- ================================================================

DROP TABLE IF EXISTS "invites" CASCADE;
CREATE TABLE "invites" ("id" UUID NOT NULL, "call_id" UUID NOT NULL, "institution_id" UUID, "code_hash" TEXT NOT NULL, "expires_at" TIMESTAMP WITH TIME ZONE, "used_by_applicant" UUID, "used_at" TIMESTAMP WITH TIME ZONE, "meta" JSONB, "created_by_user_id" UUID, "created_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(), "email_sent" BOOLEAN NOT NULL DEFAULT false, "sent_at" TIMESTAMP WITH TIME ZONE, "sent_count" INTEGER NOT NULL DEFAULT 0);

ALTER TABLE "invites" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: milestone_progress
-- ================================================================

DROP TABLE IF EXISTS "milestone_progress" CASCADE;
CREATE TABLE "milestone_progress" ("id" UUID NOT NULL, "application_id" UUID NOT NULL, "milestone_id" UUID NOT NULL, "form_submission_id" UUID, "status" VARCHAR DEFAULT 'PENDING'::character varying, "started_at" TIMESTAMP WITH TIME ZONE, "completed_at" TIMESTAMP WITH TIME ZONE, "completed_by" UUID, "notes" TEXT, "created_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(), "updated_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(), "review_status" VARCHAR, "review_notes" TEXT, "reviewed_by" UUID, "reviewed_at" TIMESTAMP WITH TIME ZONE);

ALTER TABLE "milestone_progress" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: milestones
-- ================================================================

DROP TABLE IF EXISTS "milestones" CASCADE;
CREATE TABLE "milestones" ("id" UUID NOT NULL, "call_id" UUID NOT NULL, "form_id" UUID, "name" VARCHAR NOT NULL, "description" TEXT, "order_index" INTEGER NOT NULL DEFAULT 0, "required" BOOLEAN DEFAULT true, "who_can_fill" VARCHAR[] DEFAULT ARRAY['APPLICANT'::character varying], "due_date" TIMESTAMP WITH TIME ZONE, "status" VARCHAR DEFAULT 'ACTIVE'::character varying, "created_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(), "updated_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(), "start_date" TIMESTAMP WITH TIME ZONE);

ALTER TABLE "milestones" ADD PRIMARY KEY ("id");



-- ================================================================
-- Tabla: password_change_tokens
-- ================================================================

DROP TABLE IF EXISTS "password_change_tokens" CASCADE;
CREATE TABLE "password_change_tokens" ("id" UUID NOT NULL, "user_id" UUID NOT NULL, "token" VARCHAR NOT NULL, "used" BOOLEAN DEFAULT false, "expires_at" TIMESTAMP WITH TIME ZONE NOT NULL, "created_at" TIMESTAMP WITH TIME ZONE DEFAULT now());

ALTER TABLE "password_change_tokens" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: password_resets
-- ================================================================

DROP TABLE IF EXISTS "password_resets" CASCADE;
CREATE TABLE "password_resets" ("id" UUID NOT NULL, "user_id" UUID NOT NULL, "token_hash" TEXT NOT NULL, "expires_at" TIMESTAMP WITH TIME ZONE NOT NULL, "used_at" TIMESTAMP WITH TIME ZONE, "requested_ip" INET, "requested_user_agent" TEXT, "consumed_ip" INET, "consumed_user_agent" TEXT, "created_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now());

ALTER TABLE "password_resets" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: password_set_tokens
-- ================================================================

DROP TABLE IF EXISTS "password_set_tokens" CASCADE;
CREATE TABLE "password_set_tokens" ("id" UUID NOT NULL, "user_id" UUID NOT NULL, "token_hash" TEXT NOT NULL, "expires_at" TIMESTAMP WITH TIME ZONE NOT NULL, "used_at" TIMESTAMP WITH TIME ZONE, "issued_ip" INET, "issued_user_agent" TEXT, "consumed_ip" INET, "consumed_user_agent" TEXT, "created_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now());

ALTER TABLE "password_set_tokens" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: ranking_results
-- ================================================================

DROP TABLE IF EXISTS "ranking_results" CASCADE;
CREATE TABLE "ranking_results" ("id" UUID NOT NULL, "run_id" UUID NOT NULL, "call_id" UUID NOT NULL, "application_id" UUID NOT NULL, "position" INTEGER NOT NULL, "selected" BOOLEAN NOT NULL DEFAULT false, "by_min_institution_rule" BOOLEAN NOT NULL DEFAULT false, "exclusion_reason" TEXT, "created_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(), "updated_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now());

ALTER TABLE "ranking_results" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: review_assignments
-- ================================================================

DROP TABLE IF EXISTS "review_assignments" CASCADE;
CREATE TABLE "review_assignments" ("id" UUID NOT NULL, "application_id" UUID NOT NULL, "reviewer_user_id" UUID NOT NULL, "assigned_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(), "unassigned_at" TIMESTAMP WITH TIME ZONE, "meta" JSONB);

ALTER TABLE "review_assignments" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: reviewer_verification_codes
-- ================================================================

DROP TABLE IF EXISTS "reviewer_verification_codes" CASCADE;
CREATE TABLE "reviewer_verification_codes" ("id" UUID NOT NULL, "code" VARCHAR NOT NULL, "requester_user_id" UUID NOT NULL, "pending_email" VARCHAR NOT NULL, "pending_full_name" VARCHAR NOT NULL, "pending_password_hash" TEXT NOT NULL, "used" BOOLEAN DEFAULT false, "expires_at" TIMESTAMP WITH TIME ZONE NOT NULL, "created_at" TIMESTAMP WITH TIME ZONE DEFAULT now());

ALTER TABLE "reviewer_verification_codes" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: scores
-- ================================================================

DROP TABLE IF EXISTS "scores" CASCADE;
CREATE TABLE "scores" ("id" UUID NOT NULL, "application_id" UUID NOT NULL, "criterion_id" UUID NOT NULL, "raw_value" NUMERIC, "normalized" NUMERIC, "created_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now(), "updated_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now());

ALTER TABLE "scores" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: scoring_runs
-- ================================================================

DROP TABLE IF EXISTS "scoring_runs" CASCADE;
CREATE TABLE "scoring_runs" ("id" UUID NOT NULL, "call_id" UUID NOT NULL, "criteria_snapshot" JSONB NOT NULL, "tiebreakers" JSONB, "seed" TEXT, "executed_by" UUID, "executed_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now());

ALTER TABLE "scoring_runs" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: support_messages
-- ================================================================

DROP TABLE IF EXISTS "support_messages" CASCADE;
CREATE TABLE "support_messages" ("id" UUID NOT NULL, "application_id" UUID NOT NULL, "applicant_email" VARCHAR NOT NULL, "subject" VARCHAR NOT NULL, "message" TEXT NOT NULL, "status" VARCHAR NOT NULL DEFAULT 'OPEN'::character varying, "created_at" TIMESTAMP WITHOUT TIME ZONE NOT NULL DEFAULT now(), "resolved_at" TIMESTAMP WITHOUT TIME ZONE, "resolved_by" UUID, "admin_notes" TEXT);

ALTER TABLE "support_messages" ADD PRIMARY KEY ("id");


-- ================================================================
-- Tabla: user_sessions
-- ================================================================

DROP TABLE IF EXISTS "user_sessions" CASCADE;
CREATE TABLE "user_sessions" ("id" UUID NOT NULL, "user_id" UUID NOT NULL, "refresh_token_hash" TEXT NOT NULL, "token_family_id" UUID NOT NULL, "rotated_from_session_id" UUID, "user_agent" TEXT, "ip" INET, "expires_at" TIMESTAMP WITH TIME ZONE NOT NULL, "revoked_at" TIMESTAMP WITH TIME ZONE, "created_at" TIMESTAMP WITH TIME ZONE NOT NULL DEFAULT now());

ALTER TABLE "user_sessions" ADD PRIMARY KEY ("id");

